import React from "react";
import ContactUs from "./contact-us/ContactUs";
import Footer from "./footer/Footer";
import Header from "./header/Header";

const ContactUsM = () => {
  return (
    <>
      <Header/>
      <ContactUs />
      <Footer/>
    </>
  );
};

export default ContactUsM;
